import React, { useEffect, useRef } from "react";
import "../../css/HomePage.css";

//Images
import apple from "../../Images/apple.png";
import banana from "../../Images/banana.png";
import orange from "../../Images/orange.png";
import strawberry from "../../Images/strawberry.png";
import clock from "../../Images/clock.png";
import statistics from "../../Images/statistics.png";
import success from "../../Images/success.png";

const Home = () => {
  const infoTabRefs = useRef([]);

  useEffect(() => {
    const observers = infoTabRefs.current.map((tab, index) => {
      const observer = new IntersectionObserver(
        (entries) => {
          entries.forEach((entry) => {
            if (entry.isIntersecting) {
              if (index === 1) {
                // info-tab2
                tab.style.animation =
                  "BubbleUpInfoTab2 1s ease-in-out 0.1s forwards";
              } else {
                tab.classList.add("animate");
              }
              observer.unobserve(tab);

              // Remove the animation after it's done
              setTimeout(() => {
                if (index !== 1) {
                  tab.classList.remove("animate");
                } else {
                  tab.style.animation = "none";
                  tab.style.opacity = "1";
                  tab.style.transform = "scale(1)";
                }
              }, 1100);
            }
          });
        },
        { threshold: 0.1 }
      );

      observer.observe(tab);
      return observer;
    });

    return () => {
      observers.forEach((observer) => observer.disconnect());
    };
  }, []);

  return (
    <div className="home-container">
      <div class="hero-container">
        <h1 className="welcome-text">
          <span className="greeting-text">Welcome to</span>
          <br />
          <span className="brand-name">Fitness-Tracker</span>
          <br />
          <button className="get-started-button">Get Started</button>
        </h1>
        <div className="green-circle">
          <img key="1" src={apple} alt="Fruit-1" className="fruit-1" />
          <img key="2" src={strawberry} alt="Fruit-2" className="fruit-2" />
          <img key="3" src={orange} alt="Fruit-3" className="fruit-3" />
          <img key="4" src={banana} alt="Fruit-4" className="fruit-4" />
        </div>
      </div>

      <div className="content-container">
        <div className="about-us">
          <h1>Why Fitness Tracker?</h1>
          <div
            ref={(el) => (infoTabRefs.current[0] = el)}
            className="info-tab1 info-tab"
          >
            <img
              key="1"
              src={statistics}
              alt="Statistics"
              className="statistics"
            />

            <img key="3" src={orange} alt="Fruit-3" className="fruit-3" />
            <p>Personalize</p>
          </div>
          <div
            ref={(el) => (infoTabRefs.current[1] = el)}
            className="info-tab2 info-tab"
          >
            <img key="2" src={success} alt="Success" className="success" />

            <p>Achieve</p>
          </div>
          <div
            ref={(el) => (infoTabRefs.current[2] = el)}
            className="info-tab3 info-tab"
          >
            <img key="3" src={clock} alt="Clock" className="clock" />

            <img key="4" src={banana} alt="Fruit-4" className="fruit-4" />
            <p>Track</p>
          </div>
        </div>
        <div className="user-reviews">
          <div className="bottom-left-circle">
            <img key="1" src={strawberry} alt="Fruit-1" className="fruit-1" />
            <img key="2" src={apple} alt="Fruit-2" className="fruit-2" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
